import './styles/Menu.css';

const Menu = ({ onClick }) => {
    return (
    <div className="menu">
        <div className="floating" id="title">Tetris</div>
        <button className="button" onClick={onClick}>
            <div class="dots-container">
                <div class="dot"></div>
                <div class="dot"></div>
                <div class="dot"></div>
                <div class="dot"></div>
            </div>
            Start
        </button>
    </div>
    )
}

export default Menu;
